        <div>
            <b>{user.username}</b>
            <span>({user.email})</span>
            <button onClick={()=> onpointermove(user.id)}>삭제</button>
        </div>
    )
}

function UserList({users}) {

    return (
        <div>
            {users.map(user =>(
            <User user={user} key={user.id} onReove={onRemove}/>
            ))}
        </div>
    );
}

export default UserList;
